import React, { useState, useEffect } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  TextField,
} from '@mui/material';
import axios from 'axios';
import { API_ENDPOINTS } from '../config/api';

function ProductList() {
  const [products, setProducts] = useState([]);
  const [open, setOpen] = useState(false);
  const [newProduct, setNewProduct] = useState({
    product_name: '',
    product_category: '',
    product_price: '',
    product_image: '-'
  });

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await axios.get(API_ENDPOINTS.PRODUCTS);
      setProducts(response.data);
    } catch (error) {
      console.error('Error fetching products:', error);
    }
  };

  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const handleChange = (e) => {
    setNewProduct({
      ...newProduct,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async () => {
    try {
      console.log('Submitting product:', newProduct);
      const response = await axios.post(API_ENDPOINTS.PRODUCTS, newProduct);
      console.log('Response:', response.data);
      fetchProducts();
      handleClose();
      setNewProduct({
        product_name: '',
        product_category: '',
        product_price: '',
        product_image: '-'
      });
    } catch (error) {
      console.error('Error creating product:', error);
      console.error('Error details:', error.response?.data);
    }
  };

  return (
    <div className="ml-64 p-8">
      <div className="max-w-6xl mx-auto">
        <div className="flex justify-between items-center mb-8">
          <h1 className="text-3xl font-bold text-[#2E856E]">Product</h1>
          <button
            onClick={handleOpen}
            className="bg-[#2E856E] text-white px-6 py-2 rounded-full hover:bg-[#236B57] transition-colors"
          >
            Add Product
          </button>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {products.map((product) => (
            <div
              key={product.id}
              className="bg-white rounded-2xl shadow-lg overflow-hidden hover:shadow-xl transition-shadow"
            >
              <div className="h-48 bg-[#98DBBC] flex items-center justify-center">
                {product.product_image !== '-' ? (
                  <img
                    src={product.product_image}
                    alt={product.product_name}
                    className="w-full h-full object-cover"
                  />
                ) : (
                  <div className="text-[#2E856E] text-5xl">üçΩÔ∏è</div>
                )}
              </div>
              <div className="p-6">
                <h3 className="text-xl font-bold text-[#2E856E] mb-2">
                  {product.product_name}
                </h3>
                <p className="text-gray-600 mb-2">
                  Category: {product.product_category}
                </p>
                <p className="text-2xl font-bold text-[#2E856E]">
                  Rp {product.product_price}
                </p>
              </div>
            </div>
          ))}
        </div>
      </div>

      <Dialog open={open} onClose={handleClose} maxWidth="sm" fullWidth>
        <DialogTitle className="bg-[#7DCEA0] text-white">Add New Product</DialogTitle>
        <DialogContent className="mt-4">
          <div className="space-y-4">
            <TextField
              autoFocus
              label="Product Name"
              name="product_name"
              fullWidth
              value={newProduct.product_name}
              onChange={handleChange}
            />
            <TextField
              label="Category"
              name="product_category"
              fullWidth
              value={newProduct.product_category}
              onChange={handleChange}
            />
            <TextField
              label="Price"
              name="product_price"
              type="number"
              fullWidth
              value={newProduct.product_price}
              onChange={handleChange}
            />
          </div>
        </DialogContent>
        <DialogActions className="p-4">
          <Button onClick={handleClose} className="text-gray-600">
            Cancel
          </Button>
          <Button
            onClick={handleSubmit}
            className="bg-[#2E856E] text-white hover:bg-[#236B57]"
          >
            Add Product
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}

export default ProductList;
